import React from "react";
import './Profile.scss'
import { Modal } from "react-bootstrap";

export default function Profile({ profileModal, setProfileModal }) {

    let options = [
        'Personal details', 
        'Domain', 
        'Change password', 
        'Leave request', 
        'Feedback'
    ]

    return (
        <>
            <Modal show={profileModal} onHide={() => setProfileModal(false)} className={'profileModal'}>
                <Modal.Header>
                    <h5>Profile</h5>
                </Modal.Header>
                <Modal.Body>
                    <div className="row">
                        <div className="col-lg-3 sideoptions">
                            {
                                options.map((obj)=>{
                                    return(
                                        <p>obj</p>
                                    )
                                })
                            }
                        </div>
                        <div className="col">

                        </div>
                    </div>
                </Modal.Body>
            </Modal>
        </>
    )
}
